import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

const  Home = () => {

    const topIndex  = {
        zIndex: '999',
        width: '60%'
    }

    const topline = {
        fontSize: '20px',
        letterSpacing: '5px',
        color: '#1f2235'
    }
    const desHeading = {
        display:'block',
        fontSize: '4em',
        fontWeight: '900',
        color: '#1f2235'
    }
    return(
        <Container fluid="sm">
            <Row>
                <Col xs={12} md={7} lg={7}>
                <div class="col-lg-7 " style={topIndex}>
                        <span style={topline}>Hello<span class="helloUnderscore"></span></span>
                        <h1 style={desHeading}>I'm <span class="multiText"></span></h1>
                        <p class="descriptionText">I'm Yasin, professional web developer with long time experience in the field</p>
                        <div>
                            <button class="btn btns">Download CV</button>
                            <button class="btn btns"  type="button" data-toggle="modal" data-target="#myModal">Connect me</button>
                        </div>
                    </div>
                </Col>
                <Col xs={12} md={5} lg={5} style={{backgroundColor : 'green'}}>
                xs=6 md=4
                </Col>
            </Row>
        </Container>
    ) 
}

export default Home;
